import React from 'react';


function eventCard(props) {
    return (
        <div >

            <img src={props.event.event_picture} alt="event piture" />
                <h1 >{props.event.event_title}</h1>
                <h5 >{props.event.event_date}</h5>
                <h5 >{props.event.start_time} - {props.event.end_time}</h5>

        </div>
    )
}

export default eventCard;
